import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {}
<h1>Welcome</h1>
<p>Welcome to the book summaries manager, where you can:</p>
<ul>
  <li>Add Book</li>
  <li>Update Book</li>
  <li>Delete Book</li>
  <li>View details of a book</li>
</ul>
